import React from 'react'
import styled from 'styled-components'
const Nav = styled.nav`
display:flex;
flex-direction:row;
`
const Header = () => {
    return (
        <nav>
            <div className="Logo">Covlive</div>
            <div className="Date">Date</div>
        </nav>
    )
}

export default Header
